import{_ as e,a}from"./chunks/kakuteh7v2_bottom.CcSPTloX.js";import{_ as d,c as r,a8 as o,o as l}from"./chunks/framework.BDnHobkS.js";const f=JSON.parse('{"title":"Holybro Kakute H7 V2","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/kakuteh7v2.md","filePath":"uk/flight_controller/kakuteh7v2.md"}'),i={name:"uk/flight_controller/kakuteh7v2.md"};function h(s,t,n,p,u,c){return l(),r("div",null,t[0]||(t[0]=[o('<h1 id="holybro-kakute-h7-v2" tabindex="-1">Holybro Kakute H7 V2 <a class="header-anchor" href="#holybro-kakute-h7-v2" aria-label="Permalink to &quot;Holybro Kakute H7 V2&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не розробляє цей (або будь-який інший) автопілот. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The <a href="https://holybro.com/collections/autopilot-flight-controllers/products/kakute-h7-v2" target="_blank" rel="noreferrer">Holybro Kakute H7 V2</a> flight controller is full of features including integrated Bluetooth, HD camera plug, dual plug-and-play 4in1 ESC ports, 9V VTX ON/OFF Pit Switch, barometer, OSD, 6x UARTs, 128MB Flash for Logging (not supported with PX4 yet), 5V and 9V BEC, and bigger soldering pad with easy layout and much more.</p><p>The Kakute H7v2 builds upon the best features of its predecessor, the <a href="./../flight_controller/kakutef7.html">Kakute F7</a>, and the <a href="./../flight_controller/kakuteh7.html">Kakute H7</a>.</p><p>The board also has an on-board barometer, LED &amp; buzzer pad, and I2C pad (SDA &amp; SCL) for external GPS/magnetometers.</p><p><img src="'+e+'" width="300px" title="KakuteH7V2 Top Image"> <img src="'+a+'" width="300px" title="KakuteH7V2 Bottom Image"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="основні-характеристики" tabindex="-1">Основні характеристики <a class="header-anchor" href="#основні-характеристики" aria-label="Permalink to &quot;Основні характеристики&quot;">​</a></h2><ul><li>MCU: Процесор STM32H743 32-біт, який працює на частоті 480 МГц</li><li>IMU: BMI270</li><li>Барометр: BMP280</li><li>OSD: AT7456E</li><li>Bluetooth-чіп на борту: вимкнено з PX4</li><li>VTX On/Off Pit Switch: Не використовується з PX4</li><li>6x UARTs (1,2,3,4,6,7; UART2 використовується для Bluetooth телеметрії)</li><li>9x Вихід PWM (8 Вихід Двигуна, 1 Світлодіод)</li><li>2x JST-SH1.0_8pin port (For Single or 4in1 ESCs, x8/Octocopter plug &amp; play compatible)</li><li>1x JST-GH1.5_6pin port (For HD System like Caddx Vista &amp; Air Unit)</li><li>Напруга вхідної батареї: 2S-8S</li><li>BEC 5В 2A &amp;Cont.</li><li>BEC 9В 1.5A Cont.</li><li>Монтаж: 30,5 х 30,5 мм / отвір Φ4 мм з прокладками Φ3 люверси</li><li>Розміри: 35 x 35мм</li><li>Вага: 8г</li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p>Плату можна придбати в одному з наступних магазинів (наприклад):</p><ul><li><a href="https://holybro.com/products/kakute-h7-v2" target="_blank" rel="noreferrer">Holybro</a></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The <em>Kakute H7v2</em> is designed to work with the <em>Tekko32</em> 4-in-1 ESC and they can be bought in combination.</p></div><h2 id="конектори-та-контакти" tabindex="-1">Конектори та контакти <a class="header-anchor" href="#конектори-та-контакти" aria-label="Permalink to &quot;Конектори та контакти&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Pin</th><th>Функція</th><th>PX4 default</th></tr></thead><tbody><tr><td>B+</td><td>Позитивна напруга батареї (2S-8S)</td><td></td></tr><tr><td>VTX+</td><td>9В вивід</td><td></td></tr><tr><td>SDA, SCL</td><td>Підключення I2C (для периферійних пристроїв)</td><td></td></tr><tr><td>5V</td><td>Вихід 5В (максимум 2A)</td><td></td></tr><tr><td>3V3</td><td>Вихід 3.3В (максимум 0.25A)</td><td></td></tr><tr><td>VI</td><td>Відеовхід з камери FPV</td><td></td></tr><tr><td>VO</td><td>Відеовихід на відеопередавач</td><td></td></tr><tr><td>CAM</td><td>Контроль OSD камери</td><td></td></tr><tr><td>G або GND</td><td>Ground</td><td></td></tr><tr><td>RSI</td><td>Аналоговий вхід RSSI (0-3,3 В) від приймача</td><td></td></tr><tr><td>R1, T1</td><td>UART1 RX та TX</td><td>TELEM1</td></tr><tr><td>R3, T3</td><td>UART2 RX та TX</td><td>Консоль відлагодження NuttX</td></tr><tr><td>R4, T4</td><td>UART4 RX та TX</td><td>GPS1</td></tr><tr><td>R6, T6</td><td>UART6 RX та TX (R6 також розташований в GH plug)</td><td>RC порт</td></tr><tr><td>R7</td><td>UART7 RX (RX знаходиться у роз&#39;ємах для використання з 4-в-1 ESC)</td><td>Телеметрія DShot</td></tr><tr><td>LED</td><td>Дріт сигнальний для адресованих світлодіодів WS2182 (не тестувався)</td><td></td></tr><tr><td>Z-</td><td>Негативна нога п&#39;єзожучка (Підключіть позитивну ногу динаміку до контакту 5В)</td><td></td></tr><tr><td>M1 до M4</td><td>Вихід сигналу двигуна (розташований у роз&#39;ємі для використання в 4-в-1 ESC)</td><td></td></tr><tr><td>M5 to M8</td><td>Вихід сигналу двигуна (розташований у роз&#39;ємі для використання в 4-в-1 ESC)</td><td></td></tr><tr><td>Завантаження</td><td>Кнопка завантажувача</td><td></td></tr></tbody></table><p><a id="bootloader"></a></p><h2 id="оновлення-завантажувача-px4" tabindex="-1">Оновлення завантажувача PX4 <a class="header-anchor" href="#оновлення-завантажувача-px4" aria-label="Permalink to &quot;Оновлення завантажувача PX4&quot;">​</a></h2><p>The board comes pre-installed with <a href="https://github.com/betaflight/betaflight/wiki" target="_blank" rel="noreferrer">Betaflight</a>. Before the PX4 firmware can be installed, the <em>PX4 bootloader</em> must be flashed. Download the <a href="https://github.com/PX4/PX4-user_guide/raw/main/assets/flight_controller/kakuteh7v2/holybro_kakuteh7v2_bootloader.hex" target="_blank" rel="noreferrer">holybro_kakuteh7v2_bootloader.hex</a> bootloader binary and read <a href="./../advanced_config/bootloader_update_from_betaflight.html">this page</a> for flashing instructions.</p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_kakuteh7v2_default</span></span></code></pre></div><h2 id="встановлення-прошивки-px4" tabindex="-1">Встановлення прошивки PX4 <a class="header-anchor" href="#встановлення-прошивки-px4" aria-label="Permalink to &quot;Встановлення прошивки PX4&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">INFO</p><p>KakuteH7v2 is supported with PX4 master &amp; PX4 v1.14 or newer. Якщо ви завантажуєте готове програмне забезпечення через QGroundcontrol, вам необхідно використовувати щоденну версію QGC або версію QGC новішу за 4.1.7. До випуску вам потрібно буде вручну зібрати та встановити прошивку.</p></div><p>Прошивку можна встановити вручну будь-якими звичайними способами:</p><ul><li><p>Збудуйте та завантажте джерело:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_kakuteh7v2_default upload</span></span></code></pre></div></li><li><p><a href="./../config/firmware.html">Load the firmware</a> using <em>QGroundControl</em>. Ви можете використовувати або готове вбудоване програмне забезпечення, або власне користувацьке програмне забезпечення.</p></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>KakuteH7v2 is supported with PX4 main and v1.14 or newer.</p></div><h2 id="конфігурація-px4" tabindex="-1">Конфігурація PX4 <a class="header-anchor" href="#конфігурація-px4" aria-label="Permalink to &quot;Конфігурація PX4&quot;">​</a></h2><p>In addition to the <a href="./../config/">basic configuration</a>, the following parameters are important:</p><table tabindex="0"><thead><tr><th>Параметр</th><th>Налаштування</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#SYS_HAS_MAG">SYS_HAS_MAG</a></td><td>Це має бути вимкнено, оскільки у платі немає внутрішнього магніту. Ви можете активувати це, якщо приєднаєте зовнішній магніт.</td></tr></tbody></table><h2 id="налаштування-послідовного-порту" tabindex="-1">Налаштування послідовного порту <a class="header-anchor" href="#налаштування-послідовного-порту" aria-label="Permalink to &quot;Налаштування послідовного порту&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>Пристрій</th><th>Порт</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>TELEM1</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>Debug Console</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>RC SBUS</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Телеметрія ESC (DShot)</td></tr></tbody></table><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><h3 id="системна-консоль" tabindex="-1">Системна консоль <a class="header-anchor" href="#системна-консоль" aria-label="Permalink to &quot;Системна консоль&quot;">​</a></h3><p>UART3 RX and TX are configured for use as the <a href="./../debug/system_console.html">System Console</a>.</p><h3 id="swd" tabindex="-1">SWD <a class="header-anchor" href="#swd" aria-label="Permalink to &quot;SWD&quot;">​</a></h3><p>The <a href="./../debug/swd_debug.html">SWD interface</a> (JTAG) pins are:</p><ul><li><code>SWCLK</code>: Test Point 2 (Pin 72 on the CPU)</li><li><code>SWDIO</code>: Test Point 3 (Pin 76 on CPU)</li><li><code>GND</code>: As marked on board</li><li><code>VDD_3V3</code>: As marked on board</li></ul>',37)]))}const k=d(i,[["render",h]]);export{f as __pageData,k as default};
